import React from "react";

function HomePageBanners(props) {
  const button5 = {
    backgroundColor: "#4e9af1",
  };

  return (
    <div class={props.classes}>
      <h1>{props.title}</h1>
      <h3>{props.description}</h3>
      {props.buttonText !=undefined ? (
        <a href={props.buttonLink} class="button" style={button5}>
          {props.buttonText}
        </a>
      ) : (
        ""
      )}
      <img alt={props.imageDescription} src={props.imageSrc} />
      {props.videoSrc !=undefined ? (
        <div class="video-container">
          <iframe class="video" src={props.videoSrc} allowfullscreen></iframe>
        </div>
      ) : (
        ""
      )}
    </div>
  );
}

export default HomePageBanners;
